import { useEffect, useState } from "react";

function Gallery() {
    const [setData] = useState([]); // store data collection

    /* fetch random pictures from unsplash */
    var unsplash = document.createElement('div');
    unsplash.innerHTML = '<h1>Unsplash</h1>';
    document.body.appendChild(unsplash);
    var unsplash_url = 'https://source.unsplash.com/random/';
    var unsplash_img = document.createElement('img');
    unsplash_img.src = unsplash_url;
    unsplash.appendChild(unsplash_img);

    useEffect(() => {
        document.title = 'Gallery';
    }, []);

    return (
        <div className="container mb-5">
            <div className="row">
                <h1 className="text-center">Cases</h1>
            {Record.map(data => {
               return (
                   <div className="col-4 mt-5">
                       <img src={data.image} alt="" className="img-fluid" />
                       <span className="data-header">{data.header}</span>
                       <br /><strong className="mt-5">{data.caption}</strong>
                   </div>
               )
            })}
            </div>
            <div>
            </div>
        </div>
    );
}

export default Gallery;
